import "./ContactsHeader.css";

export default function ContactsHeader() {
	return (
		<div class="contacts-header-content">
			<div class="contacts-headerwrapper">
				<h1>CONTACT</h1>
				<p>Feel free to contact us at your convenience and we'll be happy to get in touch with you.</p>
			</div>
		</div>
	);
}
